// Home.js
import React from 'react';
import { Box, Container, Typography, Button } from '@mui/material';
import HeroSection from './sections/HeroSection';
import FeaturesSection from './sections/FeaturesSection';
import TutorialSection from './sections/TutorialSection';
import CommunitySection from './sections/CommunitySection';

const Home = () => {
  return (
    <div>
      <HeroSection />
      <Container maxWidth="lg">
        <FeaturesSection />
        <TutorialSection />
        <CommunitySection />
        <Box mt={8} textAlign="center" style={{ marginBottom: '50px' }}>
          <Typography variant="h5" gutterBottom>
            Start creating your own games today!
          </Typography>
          <Button variant="contained" color="primary" href="#register" style={{ marginTop: '20px' }}>
            Register for Free
          </Button>
        </Box>
      </Container>
    </div>
  );
};

export default Home;
